// Custom JS

(function($){

	jQuery(document).ready(function() {
		initRetinaCover();
		initSlider();
		initAnchors();
		initAnalyzeModalForm();
		initDotDotDot();
		initCustomHover();
		if($('body').hasClass('show-mobile-form')){
			initMobNavVisibleClass();
		}
		if($('body').hasClass('u-banner-page')){
			initFixedHeaderClass();
		}
		$('.social-sidebar').stickySidebar({
			topSpacing: 120,
			resizeSensor: true,
			containerSelector: '.content',
			innerWrapperSelector: '.sidebar__inner',
		});
		$('#a-s-form').submit(function(event){
			event.preventDefault(); //prevent default action
			if($('#sf-search').val()==''){
				jQuery('<p class="form_error_msg name-empty">Please select a business location from the search results.</p>').insertAfter($('#sf-search'));
				return false;
			}
			$('.ajax-response').show().html('Please wait...');
			var form_data = $(this).serialize();

			var ajaxRequest = $.ajax({
				url: ajax_object.ajax_url,
				method: "POST",
				data: form_data, //$(this).serialize(),
				dataType: "json"
			});
			ajaxRequest.done(function (response) {
				if (response.status == 'success') {
					$('#a-s-form').hide();
					$('.ajax-response').html('').hide();
					$('.success-message').show();
					window.location.href = "https://placepull.typeform.com/to/Wctn2l";
					gtag('event', 'Apply for access', {
						'event_category': 'Form Submission',
						'event_label': `Lead Submitted`,
						'value': 4
					});

				} else {
					$('.ajax-response').html(response.message);
				}

			});
			ajaxRequest.fail(function (jqXHR, textStatus) {

				console.log("Request failed: " + textStatus);
			});
		});

	});

	function initAnalyzeModalForm(){
		var $form = $('.pp-a-form'),
				modal_src = '#analyze-modal',
				$modal_btn = $('#analyze-form-btn'),
				$modal_form = $('#a-s-form'),
				$progress_bar = $('.a-s-form__progress-bar');

		var IsplaceChange = false;	
		var searchInput = document.getElementById('sf-search');
		var place,
				autocomplete,
                                autocomplete_2,
				autocompleteOptions = {
					types: ['establishment'],
					fields: ['name', 'international_phone_number', 'website', 'formatted_address', 'place_id'],
					componentRestrictions: {country: 'us'}
				};

		function initAutocomplete() {
			autocomplete = new google.maps.places.Autocomplete(searchInput, autocompleteOptions);
			google.maps.event.addListener(autocomplete, 'place_changed', function(){
				place = autocomplete.getPlace();

				$modal_form.find('#sf-place-phone').val(place.international_phone_number)
				$modal_form.find('#sf-place-name').val(place.name)
				$modal_form.find('#sf-place-address').val(place.formatted_address);

				IsplaceChange = true;
			});
			
			var inputs = document.getElementsByClassName('pre-sf-search-input');
			var autocompletes = [];
			for (var i = 0; i < inputs.length; i++) {
               autocomplete_2 = new google.maps.places.Autocomplete(inputs[i], autocompleteOptions);
               autocomplete_2.inputId = inputs[i].id;
			   autocompletes.push(autocomplete_2)
                autocomplete_2.addListener('place_changed', function(){
				place = this.getPlace();
				$modal_form.find('#sf-place-phone').val(place.international_phone_number)
				$modal_form.find('#sf-place-name').val(place.name)
				$modal_form.find('#sf-place-address').val(place.formatted_address);

				IsplaceChange = true;
			});
              autocompletes.push(autocomplete_2);
           }
		}

		google.maps.event.addDomListener(window, 'load', $(initAutocomplete));

		$modal_btn.on('click', function(e){
			e.preventDefault();
			$.fancybox.open([{
				src: modal_src,
				touch: false
			}]);
			$modal_form.trigger('toggle:step-reset');

			gtag('event', 'Apply for access', {
				'event_category': 'Form Submission',
				'event_label': `Reached Step 1`,
				'value': 1
			});


		});

		$('.pp-a-form, .pp-a-form-mob').on('submit', function(e){
			let val = $(this).find('.i-i').val();
			e.preventDefault();
			if(!(val == '')){
				$('#sf-search').val(val)
			}
			$.fancybox.open([{
				src: modal_src,
				touch: false
			}]);

			gtag('event', 'Apply for access', {
				'event_category': 'Form Submission',
				'event_label': `Reached Step 1`,
				'value': 1
			});

			$modal_form.trigger('toggle:step-reset');
		});

		$(searchInput).keydown(function () {
            IsplaceChange = false;
        });

		$modal_form.on('toggle:step', function(e, stepNum){
			$(this).attr('data-step-active', stepNum);
			gtag('event', 'Apply for access', {
				'event_category': 'Form Submission',
				'event_label': `Reached Step ${stepNum}`,
				'value': stepNum
			});

			$('.a-s-form__pagination .p-btn').removeClass('active');
			for(i = 1; i <= stepNum; i++){
				var currActive = '*[data-toggle-step=' + i + ']';
				$(currActive).addClass('active');
			}
			
			$('.a-s-form__heading-w .img img').removeClass('active');
			$('.a-s-form__heading-w .img .image-' + stepNum).addClass('active');
			
			setProgressState(stepNum);
		}).on('toggle:step-reset', function(){
			$(this).attr('data-step-active', 1);
			$('.a-s-form__pagination .p-btn').removeClass('active');
			$('*[data-toggle-step=1]').addClass('active');
			setProgressState(1);
		})

		function setProgressState(elemNum){
			var fullLength = $('.a-s-form__pagination').width(),
				elemWidth = fullLength / 3,
				elemWidthHalf = elemWidth / 2,
				currentElem = Number(elemNum),
				distance = elemWidth * (currentElem - 1) + elemWidthHalf;
			if((100 / 3 * currentElem) === 100){
				$('.a-s-form__progress-bar .percentage').html(99 + '%');
				$('.a-s-form__progress-bar .word').html('');
			} else {
				$('.a-s-form__progress-bar .percentage').html(parseInt(100 / 3 * currentElem) + '%');
				$('.a-s-form__progress-bar .word').html('&nbsp;complete');
			}
			$('.a-s-form__progress-bar .p-status').css('margin-left', -($('.a-s-form__progress-bar .p-status').outerWidth() / 2));
			if(elemNum === 1){
				$('.a-s-form__progress-bar .p-line').width(elemWidthHalf);
			} else {
				$('.a-s-form__progress-bar .p-line').width(distance);
			}
		}

		$('#a-s-form .forward-btn, #a-s-form .back-btn, .a-s-form__pagination .p-btn').on('click', function(e){
			e.preventDefault();

			if (IsplaceChange == false) {
                $(searchInput).val('');
                if(!jQuery('.form_error_msg.name-empty').length){
					jQuery('<p class="form_error_msg name-empty">Please select a business location from the search results.</p>').insertAfter(searchInput);
                }
            }
            else {
            	jQuery('.form_error_msg.name-empty').remove();
				var stepNum =  $(this).attr('data-toggle-step');
				$modal_form.trigger('toggle:step', stepNum);

				$modal_form.find('.place_id').val(place.place_id);
            }

		})
	}

	// add classes on hover/touch
	function initCustomHover() {
		jQuery('.blog-p-list__item').touchHover({});
	}

	function initFixedHeaderClass(){
		var $win = $(window),
			$header = $('.page-header'),
			$upperBar = $('.upper-h-bar');

		$win.on('scroll', function(){
			setFixedClass();
		})
		$(function(){
			setFixedClass();
		})
		function setFixedClass(){
			if($win.scrollTop() >= 1){
				$header.addClass('fixed')
				$upperBar.addClass('hide-to-top')
			} else {
				$header.removeClass('fixed')
				$upperBar.removeClass('hide-to-top')
			}
		}
	}

	function initMobNavVisibleClass(){
		var mobNav = $('#mobile-form-bar'),
			elem = document.getElementById('intro-img'),
			debouncedShowMobNav = debounce(showMobNav, 100);

		$(function(){
			showMobNav();
		})

		$(window).on('scroll', function(){
			debouncedShowMobNav();
		});

		function showMobNav(){
			let rect = elem.getBoundingClientRect(),
				rectTop = rect.top,
				elemHeight = elem.offsetHeight;

			if((rectTop + elemHeight) <= 0){
				mobNav.addClass('visible')
			} else {
				mobNav.removeClass('visible')
			}
		}

		function debounce(func, wait, immediate) {
			var timeout;
			return function() {
				var context = this, args = arguments;
				var later = function() {
					timeout = null;
					if (!immediate) func.apply(context, args);
				};
				var callNow = immediate && !timeout;
				clearTimeout(timeout);
				timeout = setTimeout(later, wait);
				if (callNow) func.apply(context, args);
			};
		};
	}

	function initDotDotDot(){
		jQuery('.blog-p-list__item .i-ttl, .blog-p-list__item .i-desc').dotdotdot({
			height: 'watch',
			watch: true,
			truncate: 'letter'
		});
	}

	function initAnchors() {
		new SmoothScroll({
			anchorLinks: '.anchor-link-li a',
			extraOffset: function() {
				var totalHeight = 0;
				jQuery('.page-header').each(function() {
					var $box = jQuery(this);
					var stickyInstance = $box.data('StickyScrollBlock');
					if (stickyInstance) {
						stickyInstance.stickyFlag = false;
						stickyInstance.stickyOn();
						totalHeight += $box.outerHeight();
						stickyInstance.onResize();
					} else {
						totalHeight += $box.css('position') === 'fixed' ? $box.outerHeight() : 0;
					}
				});
				return totalHeight - 1;
			},
			wheelBehavior: 'none'
		});
	}

	function initSlider(){
		var storiesSlider = $('.stories-slider'),
			thingsSlider = $('.things-slider'),
			reviewsSlider = $('.reviews-slider');

		thingsSlider.each(function(){
			var storiesSwiper = new Swiper($(this), {
				loop: true,
				slidesPerView: 'auto',
      	centeredSlides: true,
				initialSlide: 1,
				speed: 300,				
				navigation: {
					nextEl: $(this).siblings('.swiper-button-next'),
					prevEl: $(this).siblings('.swiper-button-prev')
				},
			});
		});

		storiesSlider.each(function(){
			var storiesSwiper = new Swiper($(this), {
				loop: true,
				slidesPerView: 1,
				speed: 300,
				navigation: {
					nextEl: $(this).siblings('.swiper-button-next'),
					prevEl: $(this).siblings('.swiper-button-prev')
				}
			});
		});

		reviewsSlider.each(function(){
			var reviewsSwiper = new Swiper($(this), {
				loop: true,
				slidesPerView: 'auto',
				centeredSlides: true,
				initialSlide: 1,
				speed: 300,
				pagination: {
					el: $(this).siblings('.swiper-pagination'),
					type: 'bullets',
					clickable: true
				},
				navigation: {
					nextEl: $(this).siblings('.swiper-button-next'),
					prevEl: $(this).siblings('.swiper-button-prev')
				},
				breakpoints: {
					768: {
						slidesPerView: 2,
						centeredSlides: false,
						initialSlide: 0,
					},
					1024: {
						slidesPerView: 3,
						centeredSlides: false,
						initialSlide: 0,
					}
				}
			});
			$(window).on('resize', function(){
			setTimeout(function(){
				reviewsSwiper.update()
			}, 1000)
		});
		});

		var mobileSwiper;
		var $win = jQuery(window);
		var windowWidth = $win.width();
		var windowHeight = $win.height();
		var resizeTimer;

		var enableMobileSwiper = function(){
			mobileSwiper = new Swiper('.blog-posts-slider', {
				loop: true,
				roundLengths: true,
				speed: 300,
				slidesPerView: 'auto',
				initialSlide: 1,
				centeredSlides: true
			});
		}

		reInitPostSlider();

		function reInitPostSlider() {
			if($('.blog-posts-slider').length){
				if(windowWidth <= 991){
					if (mobileSwiper !== undefined) {
						mobileSwiper.destroy( true, true )
						enableMobileSwiper();
					} else {
						enableMobileSwiper();
					}
				} else {
					if (mobileSwiper !== undefined) {
						mobileSwiper.destroy( true, true )
					}
				}
			}
		}

		$win.on('resize', function(){
			clearTimeout(resizeTimer);
			resizeTimer = setTimeout(function() {
				if ($win.outerWidth() != windowWidth || $win.outerHeight() != windowHeight) {
					windowWidth = $win.width();
					windowHeight = $win.height();
					reInitPostSlider();
				}
			}, 500);
		});

	}
	// centeredSlides
	// centeredSlidesBounds


	function initRetinaCover() {
		jQuery('.bg-stretch').retinaCover();
	}

})(jQuery);


